import { Icon } from 'semantic-ui-react'

const Marker = ({lat, lng}) => {
    return(
        <div className= 'marker'>
            <Icon 
                name='map marker alternate'
                color='red' size='big'
                className='location-icon'
                />
        </div>
    )
}

export default Mar
